"use strict";(self.webpackChunkcclc_vuepress=self.webpackChunkcclc_vuepress||[]).push([[2549],{9911:(e,a,s)=>{s.r(a),s.d(a,{data:()=>r});const r={key:"v-4b8aeab0",path:"/mess-knowledge/mac-apache-service-loaded.html",title:"【Apache】/System/Library/LaunchDaemons/org.apache.httpd.plist: service already loaded 的解决方法",lang:"zh-CN",frontmatter:{title:"【Apache】/System/Library/LaunchDaemons/org.apache.httpd.plist: service already loaded 的解决方法",date:"2016-11-21",categories:["Other"],tags:["macOS","Apache"]},excerpt:"",headers:[],git:{},filePathRelative:"mess-knowledge/mac-apache-service-loaded.md"}},5299:(e,a,s)=>{s.r(a),s.d(a,{default:()=>t});var r=s(6252);const n=(0,r.uE)('<h1 id="【apache】-system-library-launchdaemons-org-apache-httpd-plist-service-already-loaded-的解决方法" tabindex="-1"><a class="header-anchor" href="#【apache】-system-library-launchdaemons-org-apache-httpd-plist-service-already-loaded-的解决方法" aria-hidden="true">#</a> 【Apache】/System/Library/LaunchDaemons/org.apache.httpd.plist: service already loaded 的解决方法</h1><p>更新 MacOS 10.12 系统后，在终端里启动 apache 时都会提示 service already loaded 的错误信息.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>/System/Library/LaunchDaemons/org.apache.httpd.plist: <span class="token function">service</span> already loaded\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>虽然它不影响我启动服务，但是强迫症患者看到这个还是很烦人的，于是就找了下面的解决方法。</p><p>一般的开机启动项可以在 System Preferences–Users&amp;Groups–Login Items 中添加或删除。可是在这里也没有发现 Apache 相关的启动项。于是谷歌到了下面一个可行的方法，打开终端，执行下面的命令。</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">sudo</span> launchctl unload <span class="token parameter variable">-w</span> /System/Library/LaunchDaemons/org.apache.httpd.plist\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>如果哪天你想让它开机启动了,则将 unload 改为 load:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code><span class="token function">sudo</span> launchctl load <span class="token parameter variable">-w</span> /System/Library/LaunchDaemons/org.apache.httpd.plist\n</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>launchd 是 Mac OS 下，用于初始化系统环境的关键进程。类似 Linux 下的 init, rc.此方法同样也适用于禁用系统的一些服务,比如打印机,蓝牙等.</p>',9),c={href:"https://liuzhichao.com/p/1667.html",target:"_blank",rel:"noopener noreferrer"},l={},t=(0,s(3744).Z)(l,[["render",function(e,a){const s=(0,r.up)("ExternalLinkIcon");return(0,r.wg)(),(0,r.iD)(r.HY,null,[n,(0,r._)("p",null,[(0,r.Uk)("文章出处："),(0,r._)("a",c,[(0,r.Uk)("https://liuzhichao.com/p/1667.html"),(0,r.Wm)(s)])])],64)}]])},3744:(e,a)=>{a.Z=(e,a)=>{const s=e.__vccOpts||e;for(const[e,r]of a)s[e]=r;return s}}}]);